import { getValue } from '@testing-library/user-event/dist/utils'
import React from 'react'


export function HomeHeader({theme, toggleTheme}) {
console.log(theme)
  return (
<div className='big-nav'>
        <div className='nav1'>
            <div className="logo-box"><img src='images/icons/BlvckLogo2.jpg' className='logo' style={{
              display: theme
            }}/>
            {/* <img src='images/icons/BlvckLogo2.jpg' className='logo' style={{
              display:theme==='light'? 'initial':'none',
            }}/> */}
            </div>
            <div className="logo-word"
            >LVCK CODA</div>
        </div>

  <div className="App-logo" onClick={toggleTheme} checked={theme==="dark"} >
     <img src='images/icons/sun.png' style={{width:'100%',
     display: theme==="dark"?'initial':'none',
    }}/>
     <img src='images/icons/moon.png' style={{
      width:'50%',
      display: theme==="light"?'initial':'none',
      }}/>
  </div>

        <div className='title'>
                DANIEL EWURUM
            
        </div>
      </div>

    
  )
}
